import React from 'react';
import SignIn from '../../components/signin/signin';
import SignOut from '../../components/signup/signup';
import {StyledWrapper} from './styles'

const SignInSignOut = () => {
	return(
		<StyledWrapper>
				<SignIn />
				<SignOut/>
		</StyledWrapper>
	) 
};

export default SignInSignOut;
